import './App.css';
import React,{ useEffect, useState } from 'react';

function App() {
  const [count,setCount] = useState(0);
  const increment=()=>{
    setCount(count+1);
  }

  return (
    <div className="App">
      <h1>Heath Chang</h1>
      <button onClick={increment}> Click </button>
    </div>
  );
}

export default App;
